"""##### Function for R2 Score, MAE, MSE, RMSE calculation"""

def eval_fun(Y_test,Y_pred):
    r2 = r2_score(Y_test,Y_pred)
    mse = mean_squared_error(Y_test,Y_pred)
    mae = mean_absolute_error(Y_test,Y_pred)
    rmse = math.sqrt(mse)
    return r2, mse, mae, rmse

